import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { CssBaseline, Container, AppBar, Toolbar, Typography, Paper, Grid, makeStyles, createStyles, withStyles } from '@material-ui/core';

import Navbar from "./components/Navbar"
// import Notes from "./components/notes"

const useStyles = theme => ({
  root: {
    flexGrow: 1
  },
  tiles: {
    padding: theme.spacing(1),
    maxHeight: "1920px",
    height: "1920px",
    maxWidth: "1080px",
    width: "1080px",
    background: "radial-gradient(circle, rgba(94,90,90,1) 85%, rgba(0,0,0,0.865983893557423) 100%)",
  },
  car: {
    padding: theme.spacing(1),
    textAlign: "center",
    color: theme.palette.text.secondary,
    height: "500px"
  },
  traffic: {
    padding: theme.spacing(1),
    textAlign: "center",
    color: theme.palette.text.secondary,
    height: "250px"
  }
});

class App extends Component{
  constructor(){
    super();
    this.state = {
      response: false
    };
  }
  // className={classes.tiles}
  render(){
    const {classes} = this.props;
    return (
      <React.Fragment>
        <CssBaseline />
        <Container fixed className={classes.tiles}>
        <Navbar />
        <br />
        <Grid container item xs={12} spacing={3}>
          <Grid item xs={6}>
          <Paper className={classes.car}> 
          </Paper>
        </Grid>

        <Grid item xs>
          <Paper className={classes.traffic} t={5}> 
            a
          </Paper>
          <Paper className={classes.traffic} m={14}> 
            b
          </Paper>
        </Grid>

        </Grid>
      </Container>
      </React.Fragment>
    )
  }
}

App.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(useStyles)(App);
